function Validator(){}Validator.prototype.username=function(a){if(a.trim().length<4){return"USERNAME_SHORT"}if(a.trim().length>25){return"USERNAME_LONG"}if(/\s/g.test(a)){return"USERNAME_SPACES"}let regex=/^([a-zA-Z0-9]+)$/;if(!regex.test(a)){return"USERNAME_REGEX"}return true};Validator.prototype.email=function(a){if(/\s/g.test(a)){return"EMAIL_SPACES"}let regex=/^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;if(!regex.test(a)){return"EMAIL_INVALID"}return true};Validator.prototype.password=function(a){if(a.trim().length<8){return"PASSWORD_SHORT"}if(a.trim().length>45){return"PASSWORD_LONG"}if(/\s/g.test(a)){return"PASSWORD_SPACES"}if(a.match(/\d/g)===null){return"PASSWORD_NUMBER"}return true};Validator.prototype.password_repeat=function(a){let pass=$("input[name=password]").val();if(pass!==a){return"PASSWORD_MATCH"}return true};Validator.prototype.name=function(a){if(a.trim().length<1){return"NAME_SHORT"}if(a.trim().length>45){return"NAME_LONG"}return true};Validator.prototype.description=function(a){if(a.trim().length<6){return"DESC_SHORT"}if(a.trim().length>120){return"DESC_LONG"}return true};